import React from 'react';
import { Grid, Paper, Typography } from '@mui/material';

const sideNavStyle = {
    height: '100vh',
    padding:'10px'
};
const sideNavPartOneStyle = {
    height: '20%', 
};

const sideNavPartTwoStyle = {
    height: '80%', 
};


const Home = () => {


    return (
        <Grid container spacing={2}>
            {/* Side Navigation */}
            <Grid item xs={2}>
                <Grid container direction="column" spacing={2}>
                    {/* First Grid */}
                    <Grid item>
                        <Paper style={{ ...sideNavStyle, ...sideNavPartOneStyle }}>
                            <Typography variant="h6">First Part</Typography>
                            {/* Add your first part content here */}
                        </Paper>
                    </Grid>
                    {/* Second Grid */}
                    <Grid item>
                        <Paper style={{ ...sideNavStyle, ...sideNavPartTwoStyle }}>
                            {/* Add content for the second part of the side navigation */}
                            <Typography variant="h6">Second Part</Typography>
                            {/* Add your second part content here */}
                        </Paper>
                    </Grid>
                </Grid>
            </Grid>
            {/* Header */}
            <Grid item xs={10}>
                <Paper>
                    <Typography variant="h6">Header</Typography>
                    {/* Add your header content here */}
                </Paper>
            </Grid>

            {/* Main Screen */}
            <Grid item xs={12}>
                <Paper>
                    <Typography variant="h6">Main Screen</Typography>
                    {/* Add your main screen content here */}
                </Paper>
            </Grid>
        </Grid>
    );
};

export default Home;
